import Link from "next/link";

const Navbar = () => <div></div>;
<ul>
  <li>
    <Link href="/">
      {" "}
      <a>Home</a>
    </Link>
  </li>
  <li>
    <Link href="/about">
      <a>About</a>
    </Link>
  </li>
</ul>;
export default Navbar;
